//日期时间选择
define([
    'dist/static/package/jquery-datetimepicker/build/jquery.datetimepicker.full.min',
    'css!dist/static/package/jquery-datetimepicker/jquery.datetimepicker.css',
], function () {
    return function (el, options) {
        jQuery.datetimepicker.setLocale('zh');
        jQuery(el).datetimepicker(options);
    }
})